script: |
  super -f text -I q1295.spq | sort > q1295.out

inputs:
  - name: q1295.spq
    data: |
      SELECT ALL + col1 AS col0 FROM tab1 (FORMAT parquet) WHERE - + col0 * 92 + - col1 * - + col0 * - ( + 14 ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q1295.out
    data: |
      14
      47
      5
